from colorama import Style, Fore
brightgreen = "\001" + Style.BRIGHT + Fore.GREEN + "\002"
brightyellow = "\001" + Style.BRIGHT + Fore.YELLOW + "\002"
reset = Style.RESET_ALL

@register("whoami")
class WhoamiBof(Bof):
	"""
	BOF provider for x64 whoami.
	Exposes `base64bof` for your resolver and implements `load_bytes()`.
	"""
	base64bof: str = ""
	x86base64bof: str = ""

	def help_menu():
		menu = """
internal version of whoami /all
run this to get the info from whoami /all without starting cmd.exe
"""

		print(brightgreen + menu + reset)
		return